import React from 'react';
import './App.css'


const App = () => {
  return (
    <div className='Atvk'>
      <header className='Header'>
        <img src='https://upload.wikimedia.org/wikipedia/commons/5/52/Free_logo.svg'></img>
      </header>
      <nav className='Nav'>

        <div><a>Profile</a></div>
        <div><a>Massages</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
        <div><a>Setting</a></div>
      </nav>

      <div className='Content'>
        <img src='https://img.freepik.com/free-photo/digital-painting-mountain-with-colorful-tree-foreground_1340-25699.jpg'/>
      </div>

    </div>
  );
}

export default App;
